public class LC_1759 {
    public static void main(String[] args) {
        System.out.println(countHomogenous(""));
    }

    public static int countHomogenous(String s) {
        //the no of times each letter will count is the number of times its sum from that
        int start = 0;
        int curr_index = 0;
        int total = 0;
        while(!s.isEmpty()) {
            //count the number of strings which are of same type
            for(int i = 0; i < s.length(); i++) {
                if((i + 1 )< s.length() && s.charAt(i) == s.charAt(i+1)) {
                    continue;
                } else {
                    curr_index = i + 1;
                    break;
                }

            }

            total = total + giveCount(curr_index);
            s = s.substring(curr_index);
            curr_index = 0;
        }

        return total;


    }

    public static int giveCount(int n) {
        return (n*( n + 1) )/2;
    }
}
